6b38fb79e99b13a8047c5a2b3c4971ff: 然而，规范与高效二者并非水火，它们就如同天平两侧的砝码，盲目追求任何一侧都会存在问题。无秩序带来的高效不可持续，牺牲效率带来的规范不可落地；所以我们要做的：是追求两者之间的平衡。
1ffe8bdc1540705ba5b145cbb963b95a: 为此，Gitee 推出了自动化功能，它可将规范具象为规则，在保持管理规范的同时，减少对业务同学效率的影响，从而让两者达到平衡。
